  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Shiawassee
  National Wildlife Refuge outlines Refuge accomplishments during the 1985 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the master plan, management
  planning, public participation, and research and investigations. Refuge administration
  is outlined; information about personnel, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, forests,
  croplands, grasslands, fire management, pest control, and wilderness and special
  areas. The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
  resources, animal control, marking and bird banding, and disease control. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, trapping, outdoor recreation, and law enforcement. The
  equipment and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment utilization and replacement, communication
  systems, and energy conservation. Cooperative programs and items of interest are
  provided at the end. Photographs and brochures are attached.\",\n\t\"owner_org\":
